The film follows the mysterious and ruthless Nikolai (Viggo Mortensen), who is tied to one of London\&amp;#039;s most notorious organized crime families. His carefully maintained existence is jarred when he crosses paths with Anna (Naomi Watts), an innocent midwife trying to right a wrong, who accidentally uncovers potential evidence against the family. Now Nikolai must put into motion a harrowing chain of murder, deceit, and retribution.
